            _this.checkAccessdenied(response);
            if (_this.sendCard || _this.sendPhar) {
            }
            else {
                $('.profile-box').addClass('add-points');
                setTimeout(function () {
                    $('.profile-box').removeClass('add-points');
                    if (!_this.questions.q7 && _this.currentTab == 'submitted') {
                        _this.newSurvey();
                    }
                }, 2000);
            }
            _this.getAccountInfo(_this.userID);
            _this.getClinic(_this.clinicID);
