    ThreeFortyBComponent.prototype.changeFilter = function (idFilter) {
        if (idFilter == 0) {
            if (!this.filterall) {
                this.filterall = true;
                this.filter0 = 0;
                this.filterhours = false;
                this.filterdrive = false;
                this.filterdelivery = false;
                this.filtersync = false;
                this.filterself = false;
                this.filter1 = 0;
                this.filter2 = 0;
                this.filter3 = 0;
                this.filter4 = 0;
                this.filter5 = 0;
            }
            else {
                this.filterall = false;
                this.filter0 = 1;
            }
        }
        if (!this.filterall && !this.filterhours && !this.filterdrive && !this.filterdelivery && !this.filtersync && !this.filterself) {
            this.filterall = true;
            this.filter0 = 0;
        }
        if (idFilter == 1) {
            if (!this.filterhours) {
                this.filterhours = true;
                this.filter1 = 1;
                this.filterall = false;
                this.filter0 = 1;
            }
            else {
                this.filterhours = false;
                this.filter1 = 0;
            }
        }
        if (idFilter == 2) {
            if (!this.filterdrive) {
                this.filterdrive = true;
                this.filter2 = 2;
                this.filterall = false;
                this.filter0 = 1;
            }
            else {
                this.filterdrive = false;
                this.filter2 = 0;
            }
        }
        if (idFilter == 3) {
            if (!this.filterdelivery) {
                this.filterdelivery = true;
                this.filter3 = 3;
                this.filterall = false;
                this.filter0 = 1;
            }
            else {
                this.filterdelivery = false;
                this.filter3 = 0;
            }
        }
        if (idFilter == 4) {
            if (!this.filtersync) {
                this.filtersync = true;
                this.filter4 = 4;
                this.filterall = false;
                this.filter0 = 1;
            }
            else {
                this.filtersync = false;
                this.filter4 = 0;
            }
        }
        if (idFilter == 5) {
            if (!this.filterself) {
                this.filterself = true;
                this.filter5 = 5;
                this.filterall = false;
                this.filter0 = 1;
            }
            else {
                this.filterself = false;
                this.filter5 = 0;
            }
        }
        // this.currentFilter = idFilter;
        if (this.isClinic) {
            if (this.selectedAdress) {
                this.getContractedPharmacies(this.selectedAdress.id);
            }
            else {
                this.getContractedPharmacies(this.currentLocation.id);
            }
        }
        else {
            this.getListPharmacyNearBySearchPlace(this.latitude, this.longitude);
        }
        for (var i = 0; i < this.patientCapture.benefits_viewed.length; i++) {
            if (this.patientCapture.benefits_viewed[i].id == idFilter) {
                this.patientCapture.benefits_viewed[i].viewed = 1;
            }
        }
    };
